// src/pages/Landingpage.js
import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

import Header from "../components/Header";
import {
  ScatterChart,
  Scatter,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  ResponsiveContainer,
} from "recharts";

import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

// Sample generated data
const generateFakeData = () =>
  Array.from({ length: 20 }, (_, i) => ({
    name: `Track ${i + 1}`,
    duration: Math.random() * 5 + 1,
    popularity: Math.floor(Math.random() * 100),
  }));

const Landingpage = () => {
  const data = generateFakeData();

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <>
      <Header />
      <div className="p-6 mt-4">
        <h1 className="text-3xl font-bold text-center mb-6">
          Discover the Power of Data in Music
        </h1>
        <p className="text-center text-gray-600 max-w-2xl mx-auto mb-10 text-sm">
          EchoTrends offers a dynamic exploration of your Spotify playlists.
          Even without logging in, you can get a glimpse of how we turn raw
          track data into meaningful insightsâ€”visually and interactively.
        </p>

        <div className="max-w-4xl mx-auto">
          <Slider {...settings}>
            <div>
              <h2 className="text-center font-semibold mb-2">
                Track Duration vs Popularity
              </h2>
              <div className="w-full h-80">
                <ResponsiveContainer width="100%" height="100%">
                  <ScatterChart>
                    <CartesianGrid />
                    <XAxis dataKey="duration" name="Duration (min)" />
                    <YAxis
                      dataKey="popularity"
                      name="Popularity"
                      domain={[0, 100]}
                    />
                    <Tooltip />
                    <Scatter name="Tracks" data={data} fill="#10b981" />
                  </ScatterChart>
                </ResponsiveContainer>
              </div>
            </div>

            <div>
              <h2 className="text-center font-semibold mb-2">Random Plot 2</h2>
              <div className="w-full h-80 bg-gray-100 flex justify-center items-center">
                <p className="text-gray-600">
                  Insert another chart or description here
                </p>
              </div>
            </div>

            <div>
              <h2 className="text-center font-semibold mb-2">Random Plot 3</h2>
              <div className="w-full h-80 bg-gray-100 flex justify-center items-center">
                <p className="text-gray-600">
                  More insights and visual data can be displayed here
                </p>
              </div>
            </div>
          </Slider>
        </div>
      </div>
    </>
  );
};

export default Landingpage;
